CREATE DEFINER=`root`@`localhost` PROCEDURE `createValue`(IN year_code1 INT, IN year1 VARCHAR(50), IN item_code1 INT, 
							 IN item1 VARCHAR(500), IN element_code1 INT, IN area_code1 INT,
							 IN area1 VARCHAR(50), IN unit1 VARCHAR(100), IN value1 INT)
BEGIN
		DECLARE unitCount INT;
		DECLARE areaCount INT;
        DECLARE itemCount INT;
        DECLARE yearCount INT;
        DECLARE valueCount INT;
        
        SELECT COUNT(*) INTO unitCount FROM unit_table
			WHERE unit = unit1 AND element_code = element_code1;
            
		IF (unitCount = 0) THEN
			INSERT INTO unit_table
				VALUES (unit1, element_code1);
		END IF;
        
		-- finding count for area parameter in area table
		SELECT COUNT(*) INTO areaCount FROM area 
			WHERE area = area1 AND area_code = area_code1;
            
		-- inserts area_code, area into area table
		IF (areaCount = 0) THEN
			INSERT INTO area
				VALUES (area_code1, area1, 1);
		END IF;
        
		-- finding count for item parameter in item table
		SELECT COUNT(*) INTO itemCount FROM item_table 
			WHERE item_code = item_code1 AND item = item1 AND element_code = element_code1;
            
		-- inserts item_code, item into item table
		IF (itemCount = 0) THEN
			INSERT INTO item_table
				VALUES (item_code1, item1, element_code1);
		END IF;
        
		-- finding count for year parameter in year table
		SELECT COUNT(*) INTO yearCount FROM year 
			WHERE year_code = year_code1 AND year = year1;
            
		-- inserts item_code, item into year table
		IF (yearCount = 0) THEN
			INSERT INTO year
				VALUES (year_code1, year1);
		END IF;
        
        SELECT COUNT(*) INTO valueCount FROM value_table
			WHERE year_code = year_code1 AND item_code = item_code1 AND area_code = area_code1;
            
        IF (valueCount = 0) THEN
			INSERT INTO value_table
				VALUES (year_code1, value1, item_code1, area_code1);
		END IF;
        
END ;;
